import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    height: 250,
    width: "100%",
  },
  image: {
      width:'100%',
   height:250
  },
  text: {
    color: "white",
    fontSize: 35,
    fontWeight: "bold",
    marginLeft: 15,
    marginTop: 180,
  },
  textP: {
    fontSize: 35,
    fontWeight: "bold",
    marginLeft: 15,
    marginBottom: 20,
  },
  texto: {
    color: "white",
    fontSize: 25,
    fontWeight: "bold",
    marginLeft: 15,
  },
  textD: {
    fontSize: 20,
    color: "#90a4ae",
  },
  textV: {
    justifyContent: "center",
    alignItems: "center",
    padding: 10,
    width: "100%",
  },
  images: {
    height: 180,
    width: 320,
    borderRadius: 30,
 marginHorizontal:10
  },
});

export default styles;
